import Customer from '../components/customer/Customer';
import Loans from '../components/customer/Loans';
import React, { Component } from 'react'
import { connect } from 'react-redux';
import { getUserById } from '../store/services/userService';
import {Redirect} from 'react-router-dom';
class CustomerProfile extends Component {
    
    componentDidMount()
    {
        if(this.props.token)
        {
            this.props.dispatch(getUserById(this));
        }
        else
        {
            return (<div>
                <h2>Login Not Succesfull!!</h2>
                <button className="btn btn-warning" onClick={()=>{this.props.history.push("/login")}}>Try Again!</button>
                </div>);
            
        }
    }

    render() {
        console.log(this.props);
     
        return (
            <div>
                <div className="container mt-5 bg-dark">
                    <h1 className="mt-5">{this.props.token}</h1>
                </div>
            </div>
        )
    }
}

const mapStateToProps = (state)=>{
    console.log(state);
    return {
        token:state.token
    }
}

export default connect(mapStateToProps)(CustomerProfile);
